import React from 'react';
import Router from 'next/router';

/**
 * Main Logo function to display AturTagihan Logo that set on top left position
 * @returns {*}
 * @constructor
 */
export default function MainLogo() {
  return (
    <img
      id="mainLogo"
      src="/icon/logo.png"
      srcSet="/icon/logo@2x.png 2x,/icon/logo@3x.png 3x"
      alt="atur tagihan"
      className="main-logo pointer"
      onClick={() => Router.push('/')}
      // style={{ top: 16, left: 8, position: 'relative' }}
    />
  );
}
